import React, { Component } from 'react'
import CBCKids from '../../../assets/CBC_Kids_2017.png'
import DisneyJunior from '../../../assets/PngItem_835216.png'

class Terms extends Component{

  displayLogos(){

    switch(this.props.country){
      // case 'Canada':
      //   return <div className="broadcasters">
      //   <img src={CBCKids}/>
      //   <img src={DisneyJunior}/>
      //   </div>
      case 'United States':
        return <div className="broadcasters">
          <img src={DisneyJunior} />
        </div>
      default:
        return  <div className="broadcasters">
          <img src={DisneyJunior} />
        </div>
    }
  }
  render(){
    return(
      <footer className="terms">
        {this.displayLogos()}
      </footer>
    )
  }
}
export default Terms
